import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="home-container">
      <h1 className="welcome-title">Bienvenido a tu base de datos de personajes</h1>
      <img className="img-logo" src="assets/Star_Wars_logo.png" />

      <div className="botonera-home">
          <a className="first-button">
              <div className="text-button">Agregar personaje</div>
          </a>
          <div className="second-button">
              <div className="text-button">Eliminar personaje</div>
          </div>
          <div className="third-button">
              <div className="text-button">Obtener personajes</div>
          </div>
      </div>
    </div>
  );
}

export default App;
